import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import axios from 'axios';
import './Reservation.css';
import Register from "./Register";
import Login from "./Login";
import { TextField } from '@mui/material';

class Reservation extends Component {
    constructor(props) {
        super(props);
        this.state = {
            firstLetter: '',
            route: 'Рута',
            from: '',
            to: '',
            date: '',
            seat: '',

        };
    }

    handleInputChange = (event) => {
        this.setState({ passengers: event.target.value });
    };

    handleChange = (event) => {
        this.setState({ [event.target.name]: event.target.value });
    };


    handleSubmit = async (event) => {
    };




    componentDidMount() {
        this.state.firstLetter = localStorage.getItem("email").charAt(0).toUpperCase();
        console.log("firstLetter", this.state.firstLetter);
    }


    render() {
        return (
            <div className="master">
                <div className="navBarReservation">
                    <div className="mainContainer">
                        <div className="firstNav">
                            <nav>
                                <ul>
                                    <li>
                                        <Link to="/">Contact</Link>
                                    </li>
                                    <li>
                                        <Link to="/">About us</Link>
                                    </li>
                                </ul>
                            </nav>
                        </div>
                        <div className="middleNav">
                            <div style={{width: '210px'}}>
                                <p>Меѓународна - Меѓуградска <b>Автобуска станица - Скопје</b></p>
                            </div>
                            <div className='img'>

                            </div>
                            <div style={{width: '150px'}}>
                                <p>International - Intercity <b>Bus Station - Skopje</b></p>
                            </div>
                        </div>
                        <div className="button-container" style={{marginLeft: '150px'}}>
                            <button className="signin-button-reservation" style={{marginLeft: '15px'}}><Link to="/login">Одјави се</Link></button>
                            <button className="circle-reservation" style={{marginLeft: '15px'}}><Link to="/">{this.state.firstLetter}</Link></button>
                        </div>
                    </div>
                </div>
                <div className="mainDiv">
                    <div>
                        <div className="breadcrumbs">
                            <p><span>{this.state.route}</span> / Патници / Багаж</p>
                        </div>
                        <div className="reservationTicket">
                            <form onSubmit={this.handleSubmit}>
                                <h3>Резервирај билет</h3>

                                <TextField
                                    name="from"
                                    label="Од"
                                    type="text"
                                    value={this.state.from}
                                    onChange={this.handleChange}
                                    required
                                /> <br />
                                <TextField
                                    name="to"
                                    label="До"
                                    type="text"
                                    value={this.state.to}
                                    onChange={this.handleChange}
                                    required
                                /> <br />
                                <TextField
                                    name="date"
                                    label="Датум"
                                    type="date"
                                    value={this.state.date}
                                    onChange={this.handleChange}
                                    required
                                    InputLabelProps={{
                                        shrink: true,
                                    }}
                                />
                                <TextField
                                    id="outlined-number"
                                    label="Седиште"
                                    type="number"
                                    value={this.state.seat}
                                    onChange={this.handleInputChange}
                                />
                            </form>
                        </div>
                    </div>
                </div>
                <div className="footer">
                    <div className="middleNav" style={{marginLeft: '535px'}}>
                        <div style={{width: '210px'}}>
                            <p>Меѓународна - Меѓуградска <b>Автобуска станица - Скопје</b></p>
                        </div>
                        <div className='img1'>

                        </div>
                        <div style={{width: '150px'}}>
                            <p>International - Intercity <b>Bus Station - Skopje</b></p>
                        </div>
                    </div>
                    <div style={{borderTop: '1px solid gray', width: '1300px', marginLeft: '100px', marginRight: '100px'}}>

                    </div>
                    <div>
                        <nav >
                            <ul style={{width: '1450px'}}>
                                <li>
                                    <Link to="/" style={{color: 'white'}}>Privacy Policy</Link>
                                </li>
                                <li>
                                    <Link to="/" style={{color: 'white'}}>Terms of Service</Link>
                                </li>
                                <li>
                                    <Link to="/" style={{color: 'white'}}>Cookies Settings</Link>
                                </li>
                                <li style={{marginLeft: '650px'}}>
                                    2023 International Intercity bus station Skopje. All right reserved.
                                </li>
                            </ul>
                        </nav>
                    </div>
                </div>
            </div>
        );
    }
}

export default Reservation;
